import React from 'react';

const FilterForm = ({ filters, onChange, onGenerate, onDownload, showDownload }) => {
  return (
    <div style={{ marginBottom: '1rem' }}>
      <input name="name" placeholder="Name" value={filters.name} onChange={onChange} />
      <input name="class" placeholder="Class" value={filters.class} onChange={onChange} />
      <input name="studentId" placeholder="Student ID" value={filters.studentId} onChange={onChange} />
      <input name="vaccinationName" placeholder="Vaccine Name" value={filters.vaccinationName} onChange={onChange} />
      <input name="vaccinationDate" type="date" value={filters.vaccinationDate} onChange={onChange} />
      <input name="vaccinationStatus" placeholder="Vaccination Status" value={filters.vaccinationStatus} onChange={onChange} />
      <button onClick={onGenerate}>Generate Report</button>
      {showDownload && <button onClick={onDownload}>Download CSV</button>}
    </div>
  );
};

export default FilterForm;
